import React from 'react';
import '../index.css'

const OutputScreen = (props) => {
  return (
    <div className='row'>
      <div className='col-1'>
      Input&nbsp;&nbsp;
      <input className="screen-row" type="text" readOnly value = {props.question}/>&nbsp;&nbsp;
      </div>
      <div className='col-1'>
      Output&nbsp;&nbsp;
      <input className="screen-row" type="text" readOnly value = {props.answer}/>
    </div>
    </div>
  )
}
export default OutputScreen;
